import React, { Component } from 'react';

export class Registration extends Component {
    constructor(props){
        super(props);
        this.state = {
            username:"",
            password:"",
            password_confirmation:""
        }
    }
    render() {
        return (
            <div>
                Registration goes here
            </div>
        );
    }
}

export default Registration;
